import React from 'react'

const NewsList = (props) => {
    const output = props.newsValue.map((item) =>{
        return (
            <div>
                <h2>{item.id}</h2>
            </div>
        )
    })
    return (
        <p onClick={this.output}></p>
    )
}

export default NewsList
